import Layout from '../components/Layout'



const Index = (props) =>{
    return(
        <Layout activeClass={props.url.pathname}>
            <_banner/>
        </Layout>
    )
}

const _banner = () =>{
    return (
        <div className="banner">
            <div className="bg-banner">

            </div>
        </div>
    )
}


export default Index;
